import React from 'react';

function AboutPage() {
	return (
		<>
			<h1>About ABC Mart</h1>
			<p>
				This is the website for ABC Mart. We used React! Did you know that ABC
				Mart has achieve over 75% Market penetration in every industry?
			</p>
		</>
	);
}
